import React from 'react';

const StockChart = ({x, y, line}) => {

   var trace1 = {
     x: [1, 2, 3, 4],
     y: [10, 15, 13, 17],
     mode: 'markers'
   };

   var trace2 = {
     x: [2, 3, 4, 5],
     y: [16, 5, 11, 10],
     mode: 'lines'
   };

   var data = [ trace1, trace2];
   var layout = {};

   Plotly.newPlot('stockGraph', data, layout, {showSendToCloud: true});

   return (
    <section className="graph">
      <div id='stockGraph'></div>
    </section>
   )
}



export default StockChart;
